import styled from "styled-components";

const Container = styled.div`
  width: 100%;
`;
const Title = styled.div`
  width: 100%;
  height: 120px;
  text-align: center;
  line-height: 120px;
  font-size: 50px;
  margin-top: 50px;
`;
const Contents = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  margin-top: 50px;
  height: 600px;
`;
const Logo = styled.div`
  width: 400px;
  height: 400px;
`;
const Aside = styled.div`
  margin-left: 50px;
  height: 400px;
  width: 740px;
`;

export function Intro() {
  return (
    <>
      <Container>
        <Title>
          <span> 메모리얼 소개</span>
        </Title>
      </Container>
    </>
  );
}
